  [],\n\t\"num_tags\": 0,\n\t\"name\": \"chemical-and-benthos-data-collected-from-ctd-bottle-and-other-instruments-in-the-chukchi-sea-in\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This accession contains physical, chemical,
  and biological data collected during research cruises for the Chukchi Sea Offshore
  Monitoring in Drilling Area (Chemical and Benthos) (COMIDA CAB) project. The study
  occurred at 65 stations in the Chukchi Sea in July and August of 2009 and 2010,
  and involved sensor measurements and sampling of water, sediment, and biota conducted
  by investigators from several universities and research organizations. The dataset
  includes more than 36,000 data values across 150+ variables, 500+ taxonomic names,
  and 100+ collection and analysis methods. Seawater samples include variables such
  as salinity, chlorophyll a, particulate organic carbon, total suspended solids,
  and temperature. Samples from the benthic zone include variables such as taxonomic
  counts, biomass, biomarkers, DNA damage, and stable isotopes. Sediment samples include
  variables such as hydrocarbons, metals, grain size distribution, and carbon to nitrogen
  molar ratio. Data are organized in folders for each investigator who collected the
  data. A sites.csv file provides station locations and dates for all samples.\",\n\t\"owner_org\":
